INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (6,'29299-5','Reason for visit','This section records the patients reason for their visit (the providers description of the reason for visit).
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (7,'42348-3','Advance directives','Advance directives contains data defining the patients direction of care and any reference to supporting documentation. The most recent and up-to-date directives are required, if known, and should be listed in as much detail as possible. Advance directives contains data such as the existence of living wills, healthcare proxies, and CPR and resuscitation status.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (8,'48765-2','Allergies','Contains a list and description of any allergies or adverse reactions pertinent to current or past medical history. At a minimum this section should contain currently active and any relevant historical allergies and adverse reactions.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (9,'46239-0','Chief complaint+Reason for visit Narrative','This term is used to record the patients chief complaint (the patients own description) and/or the reason for the patients visit (the providers description of the reason for visit). Local policy determines whether the information is divided into two sections or recorded in one section serving both purposes.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (10,'10154-3','Chief complaint Narrative - Reported','Chief complaint records the patients primary complaint (the patients own description).',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (11,'10157-6','Family history','History of family member diseases is a report of health information, including medical, genetic, environmental, and lifestyle factors, pertaining to the patient and his or her genetic relatives (living or deceased). The family history information is used to determine possible or relevant health risk factors that may have a potential impact on the patients healthcare risk profile.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (12,'47420-5','Functional status assessment note','Functional status assessment describes the patients status of normal functioning at the time a care record was created. Functional statuses include information regarding the patient relative to ambulatory ability, mental status or competency, activities of daily living (ADLs) (i.e. bathing, dressing, feeding, grooming), home/living situation having an effect on the health status of the patient, ability to care for self, social activity (i.e. issues with social cognition, participation with friends and acquaintances other than family members), occupation activity (i.e. activities partly or directly related to working), housework or volunteering, family and home responsibilities or activities related to home and family, communication ability (i.e. issues with speech, writing or cognition required for communication), and perception, including sight, hearing, taste, skin sensation, kinesthetic sense, proprioception, or balance.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (13,'10210-3','General status','Physical findings (of general status) describes general observations and readily observable attributes of the patient, including affect and demeanor, apparent age compared to actual age, gender, ethnicity, nutritional status based on appearance, body build and habitus (e.g., muscular, cachectic, obese), developmental or other deformities, gait and mobility, personal hygiene, evidence of distress, and voice quality and speech.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (14,'10164-2','History of Present illness Narrative','History of present illness describes the history related to the reason for a given procedure. It contains the historical details leading up to and pertaining to the patients current complaint or reason for seeking medical care. Because history of present illness can include past surgical history and other procedures, the Procedure History section may be included under the History of Present Illness section or it may stand alone as its own section.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (15,'11369-6','History of immunizations','History of immunizations defines a patients immunization status for the context and use case of the document type. Often included is current immunization status and possibly the entire immunization history.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (16,'46264-8','History of medical device use','History of medical device (medical equipment) use defines a patients implanted and external medical devices and equipment that their health status depends on, as well as any pertinent equipment or device history. This term is also used to itemize any pertinent current or historical durable medical equipment (DME) used to help maintain the patients health status. All pertinent equipment relevant to the diagnosis, care, and treatment of a patient should be included.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (17,'18785-6','Radiology Reason for study',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (18,'10160-0','Medications','History of medication use defines a patients current medications and history of pertinent medications. This term may also include a patients prescription and dispense history.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (19,'10190-7','Mental status Narrative','Observations and evaluations related to a patients psychological and mental competency and deficits including, but not limited to any of the following types of information: appearance, attitude, behavior/psychomotor, mood and affect, speech and language, thought process, thought content, perception, cognition, and insight and judgment.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (20,'61144-2','Diet and nutrition Narrative','This section houses diet information such as special diets, restrictions, NPO, liquids only, etc..',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (21,'11450-4','Problems',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (22,'47519-4','Procedures','This section defines all interventional, surgical, diagnostic, or therapeutic procedures or treatments pertinent to the patient historically and at the time the document is generated.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (23,'30954-2','Results',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (24,'10187-3','Review of systems','The Review of systems section contains a relevant collection of symptoms and functions systematically gathered by a clinician. It includes symptoms the patient is currently experiencing, some of which were not elicited during the history of present illness, as well as a potentially large number of pertinent negatives, for example, symptoms that the patient denied experiencing.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (25,'29762-2','Social history','The Social history section contains data defining the patients occupational, personal (e.g. lifestyle), social, and environmental history and health risk factors, as well as administrative data such as marital status, race, ethnicity and religious affiliation.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (26,'8716-3','Vital signs','The Vital signs section includes blood pressure, body temperature, heart rate, and respiratory rate. It may also include other clinical findings, such as height, weight, body mass index, head circumference, and pulse oximetry. In particular, notable vital signs or physical findings such as the most recent, maximum and/or minimum, baseline, or relevant trends may be included.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (27,'8648-8','Hospital course Narrative','Hospital course describes the sequence of events from admission to discharge in a hospital facility.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (28,'78375-3','Discharge diagnosis Narrative','The discharge diagnosis describes the patients relevant problems or diagnoses that occurred during an encounter (such as a hospital admission or a nursing home stay) or that need to be followed up after such an encounter. This term was created for, but is not limited in use to, the consolidated CDA Release 2.1 Discharge Diagnosis section.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (29,'75311-1','Discharge medications Narrative','Medications that the patient is intended to take (or stop) after discharge. This may also include a patients prescription history and indicate the source of the medication list, for example, from a pharmacy system versus from the patient.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (30,'42347-5','Admission diagnosis (narrative)',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (31,'42346-7','Medications on admission (narrative)','Admission can refer to hospital admission, long-term care admission, or home health admission.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (32,'42344-2','Discharge diet (narrative)','Discharge diet is a narrative description of the expectations for diet, including proposals, goals, and order requests for monitoring, tracking, or improving the dietary control of the patient, used in a discharge from a facility such as an emergency department, hospital, or nursing home.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (35,'18841-7','Hospital consultations Document',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (36,'8653-8','Hospital Discharge instructions',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (37,'10184-0','Hospital discharge physical findings Narrative','Hospital discharge physical findings records a narrative description of the patients physical findings.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (38,'11493-4','Hospital discharge studies summary Narrative',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (39,'11329-0','History general','History general describes all aspects of medical history of the patient even if not pertinent to the current procedure, and may include chief complaint, past medical history, social history, family history, surgical or procedure history, medication history, and other history information. The history may be limited to information pertinent to the current procedure or may be more comprehensive. It may also be reported as a collection of random clinical statements or it may be reported categorically. Categorical report formats may be divided into multiple subsections, including Past Medical History and Social History.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (40,'55115-0','Request (Radiology)','Information on requested imaging studies and associated tests. It may include information on the reason for the request.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (41,'55111-9','Current imaging procedure descriptions Document','Contains information on current imaging studies and associated tests.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (42,'55114-3','Prior procedure descriptions','Contains information on past imaging studies and associated tests.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (43,'18834-2','Radiology Comparison study - observation',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (44,'18782-3','Radiology Study observation (findings)','Radiology study observation (or Findings) contains the main narrative body of a radiology report. While not an absolute requirement for transformed DICOM SR reports, it is suggested that Diagnostic Imaging Reports authored in CDA follow Term Info guidelines for the codes in the various observations and procedures recorded in this section.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (45,'19005-8','Radiology - Impression',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (46,'18783-1','Radiology Study recommendation',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (47,'55110-1','Conclusions','Contains conclusions and diagnoses that result from the interpretation process.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (48,'55107-7','Addendum','Supplementary information or an appendix added to the original document contents.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (49,'18785-6','Radiology Reason for study',NULL,NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (50,'55108-5','Patient presentation','Aspects of the patient that are specific to this clinical presentation, e.g.: transferred from, admission date/time, indications for procedure, etc.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (51,'55109-3','Complications','Information on additional medical problems that develop following a procedure, diagnostic test or study, treatment, or illness.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (52,'55112-7','Summary','The essence of the document.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
INSERT INTO thr_object_sections(object_section_id,object_section_code,object_section_name,note,order_seq,valid_from,valid_to,creation_date,created_by,last_update_date,last_updated_by,status) VALUES (53,'55113-5','Key images','List of references to images considered significant.',NULL,'2022-01-26',NULL,'2022-01-26','BYDEV','2022-01-26','BYDEV','D');
